import React, { useEffect, useState } from 'react'; 
import { useHistory, useParams } from 'react-router-dom';
import { fetchDisciplinesData } from '../api/countryAPI'; // Предположим, что функция fetchDisciplinesData есть
import { Container, Col, Row } from 'react-bootstrap'; 
import { COUNTRIES_ROUTE } from '../utils/consts';

const DisciplineCountry = () => {
    const [country, setCountry] = useState(null);
    const { name, cou } = useParams();  // name — дисциплина, cou — страна

    const history = useHistory();

    // Функция, которая будет получать данные для дисциплины и страны
    useEffect(() => {
        if (cou && name) {
            fetchDisciplinesData(name, cou)
                .then(data => setCountry(data))
                .catch(error => console.error(error));
        }
    }, [cou, name]);

    if (!country) {
        return <div>Loading...</div>;  // Показать индикатор загрузки
    }

    const containerStyle = {
        position: 'relative',
        backgroundImage: 'url(/images/bg.png)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        padding: '0px',  
        height: '100vh',
        width: '100vw',
        color: "white"
    };

    const imgStyle = {
        display: 'block',
    };

    const prev = {
        ...imgStyle,
        top: '15px',
        left: '10px',
        margin: "30px"
    };

    const logo = {
        ...imgStyle,
        top: '15px',
        left: '150px',
        margin: "15px",
        marginLeft: "71px",
        height: "57px",
    };

    const flag = {
        marginLeft: "135px",
    };

    const h1 = {
        color: "white",
        textAlign: "center",
    };

    const table = {
        justifyContent: 'center',
        alignItems: 'center',
        marginTop: '20px',
        width: '100%',
    };

    const tableChild1 = {
        padding: "0px 5px 20px 5px",
        textAlign: 'center',
        border: "1px solid white",
        borderTop: "0px",
        margin: "0px",
    };

    const totalMedalsStyle = {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
    };

    const g = {
        padding: "20px 20.485px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom: "0px",
    };

    return (
        <Container style={containerStyle}>
            <Row>
                <img style={prev} src='/images/ico-prev.svg' alt='paris' onClick={() => history.push(COUNTRIES_ROUTE + `/${country.name}`)} />
                <img style={logo} src='/images/logo-sm-white.png' alt='paris' />
            </Row>
            <Col className='p-0'>
                <h1 style={h1}>{country.name}</h1>
                <img style={flag} src={`/images/flags/${country.name.replace(' ', '')}.png`} alt={country.name} />
            </Col>
            <Col style={totalMedalsStyle}>
                <h5>{name} Discipline Medals</h5>
            </Col>
            <table>
                <thead>
                    <tr style={table}>
                        <th><h5 style={tableChild1}>DISCIPLINE</h5></th>
                        <th><h5 style={tableChild1}>MEDALS</h5></th>
                    </tr>
                </thead>
                <tbody>
                    <tr style={table}>
                        <td><h5 style={g}>{name}</h5></td>
                        <td><h5 style={g}>{country.medals.gold + country.medals.silver + country.medals.bronze}</h5></td>
                    </tr>
                </tbody>
            </table>
        </Container>
    );
};

export default DisciplineCountry;
